import React from 'react';
import SignatureCanvas from 'react-signature-canvas';

const signature = () => {
  return (
    <>
      <h1>This is signature page..</h1>
      <SignatureCanvas
        penColor="black"
        backgroundColor="red"
        canvasProps={{ width: 500, height: 200, className: 'sigCanvas' }}
        ref={ref => {
          this.sigCanvas = ref;
        }}
      />
    </>
  );
};

export default signature;
